const EventDuration = (dataArray) => {
    const lineChartData = [];

    dataArray.forEach((eventsArray) => {
        eventsArray.forEach((event) => {
            const eventType = event.EventType;
            const startTimestamp = new Date(event.Start);
            const endTimestamp = new Date(event.End);
            const duration = endTimestamp - startTimestamp;

            const formattedData = {
                duration: duration, // Duração do evento como coordenada x
                eventType: eventType // Nome do evento como coordenada y
            };

            // Adicionar o objeto ao conjunto de dados para o gráfico de linhas
            lineChartData.push(formattedData);
        });
    });
    return lineChartData;
};

export default EventDuration;
